import './App.css';
import img from './assets/img/img4.jpg'
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
const App = () => {
  return (
    <div className='App'>
      <div className='container'>
        <img
          src={img}
          width="500" height="600"
        />

      </div>
      <div className='container'>
        <button type="button" class="btn btn-success">Order Now</button>
      </div>
    </div>
  );

}

export default App;
